            <ul>
              <li><a href="#home">HOME</a></li>
              <li><a href="/profile">PROFILE</a></li>
              <li><a href="/contact">CONTACT</a></li>
            </ul>
          </nav>
          <div className="toggle" onClick={this.handleClick}>
            <span />
            <span />
            <span />
          </div>
        </div>
      </div>
    )
  }
}

export default App;
